//SPDX-License-Identifier: MIT

pragma solidity 0.8.7;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "./ERC721A.sol";
import "./ICleverNFT.sol";

contract NFTMarketplace is Ownable {

    using SafeERC20 for IERC20;

    struct TokenData {
        address tokenAddress;
        string tokenName;
    }

    struct ListingItem {
        uint256 id;
        address NFTContractAddress;
        uint256 tokenId;
        bool purchaseWithToken;
        address tokenAddress;
        address ownerAddress;
        uint256 price;
    }

    mapping(address => TokenData) public tokens;
    TokenData[] public tokenList;
    ListingItem[] public listings;

    uint256 public minimumRequestableTokens = 50 ether;

    address public accessNFTAddress = 0x72552b64b54C5ADe05aAd3c95D396A6d6F43c5d2;
    address public cleverNFTAddress = 0xbBBb110bc7Cae8610E5887bCf25B1103A399918E;

    ICleverNFT cleverNFT;

    constructor() {

        cleverNFT = ICleverNFT(cleverNFTAddress);
    }


    function addToken(string memory tokenName_, address tokenAddress_) public onlyOwner {
        
        require(tokens[tokenAddress_].tokenAddress == address(0x0), "Error: Token Already Exists");

        TokenData memory tokenData_ = TokenData({
            tokenAddress: tokenAddress_,
            tokenName: tokenName_
        });

        tokens[tokenAddress_] = tokenData_;

        tokenList.push(tokenData_);
    }

    function requestTestToken(address tokenAddress_) public {

        require(tokens[tokenAddress_].tokenAddress != address(0x0), "Error: Token Does Not Exists");

        IERC20(tokenAddress_).safeTransfer(msg.sender, minimumRequestableTokens);
    }

    function listItem(address NFTContractAddress_, uint256 tokenId_, address tokenAddress_, uint256 price_) public {

        bool purchaseWithToken_ = false;

        if(bytes(abi.encodePacked(tokenAddress_)).length > 0) {
            purchaseWithToken_ = true;
        }

        address NFTAddressHolder = ERC721A(NFTContractAddress_).ownerOf(tokenId_);

        require(msg.sender == NFTAddressHolder, "You do not own this NFT");

        ERC721A(NFTContractAddress_).transferFrom(msg.sender, address(this), tokenId_);

        ListingItem memory listing = ListingItem({
            id: listings.length == 0 ? 0 : listings.length + 1,
            NFTContractAddress: NFTContractAddress_,
            tokenId: tokenId_,
            purchaseWithToken: purchaseWithToken_,
            tokenAddress: tokenAddress_,
            price: price_,
            ownerAddress: msg.sender
        });

        listings.push(listing);
    }

    function mintCleverNFT(string memory metadata) public onlyAccessNFT {

        cleverNFT.mint(msg.sender, metadata);
    }

    function unlistItem(uint256 id) public {

        ListingItem memory listing = listings[id];

        require(listing.ownerAddress != address(0x0), "Id does not exists");
        require(listing.ownerAddress == msg.sender, "You do not own this listing");

        ERC721A(listing.NFTContractAddress).transferFrom(address(this), listing.ownerAddress, listing.tokenId);

        delete listings[id];
    }

    function buyNFT(uint256 id) public payable {
        
        ListingItem memory listing = listings[id];

        require(listing.ownerAddress != address(0x0), "Id does not exists");

        if(listing.purchaseWithToken) {

            require(IERC20(listing.tokenAddress).balanceOf(msg.sender) >= listing.price, "Insufficient Balance");
            
            IERC20(listing.tokenAddress).transferFrom(msg.sender, listing.ownerAddress, listing.price);
            

        } else {

            require(msg.value >= listing.price, "Insufficient Balance");

            (bool os, ) = payable(msg.sender).call{value: listing.price}("");

            require(os, "Transaction Failed");
        }

        ERC721A(listing.NFTContractAddress).transferFrom(address(this), msg.sender, listing.tokenId);
    }

    function compareStrings(string memory a, string memory b) internal pure returns (bool) {

        return (keccak256(abi.encodePacked((a))) == keccak256(abi.encodePacked((b)))); 
    }

    modifier onlyAccessNFT() {

        require(ERC721A(accessNFTAddress).balanceOf(msg.sender) > 0, "You do not have an access NFT");
        _;
    }
}

//TUSDT - 0x8FAd5ebA62540D21f2837DCfEd8956de702740f9
